import doctorImg from '../assets/doctor-main.png'

const HomeComponent = () => {
  return (
    <>
      <div className="container main-slider">
        <div className="main-heading">
          <p className="main-display">Deliver accurate and timely health care.</p>
          <p className="main-title">
            A trustworthy healthcare campanion. We really care about your health
            and consiousness.{" "}
          </p>
        </div>
        <div className="main-heading main-svg">
        <svg
    width={791}
    height={668}
    fill="none"
    xmlns="http://www.w3.org/2000/svg"
    xmlnsXlink="http://www.w3.org/1999/xlink"
    {...props}
  >
    <path
      d="M3.165 316.475C-1.486 203.224 92.848 113.855 183.94 48.476 422.33-90.926 420.522 130.854 636.934 171.67c143.245 27.016 166.503 162.636 143.245 260.974-23.257 98.339-257.947 235.58-394.321 231.257C249.484 659.578 8.98 458.038 3.165 316.475Z"
      stroke="#FF2E00"
      strokeWidth={5}
    />
    <path
      d="M23.5 345.5c-4.4-104.8 84.833-187.5 171-248 225.5-129 223.789 76.23 428.5 114C758.5 236.5 780.5 362 758.5 453s-244 218-373 214S29 476.5 23.5 345.5Z"
      fill="#2EC5BC"
    />
    <mask
      id="a"
      style={{
        maskType: "alpha",
