      <path
        d="M23.156 345.083c-4.4-104.8 84.834-187.5 171-248 225.5-129 223.79 76.23 428.5 114 135.5 25 157.5 150.5 135.5 241.5s-244 218-373 214-356.5-190.5-362-321.5Z"
