    </g>
    <defs>
      <pattern
        id="b"
        patternContentUnits="objectBoundingBox"
        width={1}
        height={1}
      >
        <use xlinkHref="#c" transform="matrix(.0005 0 0 .00075 0 0)" />
      </pattern>
      <img src="" id="image0_5_35" width="2000" height="1333"  />
    </defs>
  </svg>

          
        </div>
        <div className="image"></div>
      </div>
    </>
  );
};

export default HomeComponent;
